import { motion } from "framer-motion";
import HomeLink from "../utils/lol";

function PageNotFound() {

    return (
        <motion.div
        exit={{opacity: 0}}
        animate={{opacity: 1}}
        initial={{opacity: 0}}
        transition={{duration: 0.8}}
        >
            This page doesn't exist. Go back to <HomeLink />.
        </motion.div>
    )

}

export default PageNotFound;
